import React from "react";

import "./App.css";
import Home from "./home";

import { BrowserRouter as Router, Switch, Route } from "react-dom";

function App() {
  return (
    <Router>
      <div className="All">
        <Switch>
          <Route path="/" exact component={Home} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
